Amy and Keiran are in a hunting competition. Their goal is to bag the biggest buck, until Amy changes her mind. She wants to go from hunting deer to hunting cock. She stalks her opponent through the woods, sets a trail for Keiran to follow, and traps him inside a Cabin. Once Keiran is trapped in the cabin Amy confronts him. Only to tell him that she is now hunting him. Amy then sets to sexually devour Keiran.
